<template>
    <div class="main-container">
        <div :class="['back-background', logedin ? 'back-background-logedin' : 'back-background-logedout']"></div>
        <div :class="['signin-container', logedin ? 'signin-container-logedin' : 'signin-container-logedout']">
            <div class="close-btn-container">
                <button @click="openCloseLogin">
                    <div></div>
                </button>
            </div>
            <div class="header-img x-padding">
                        <img src="data:image/png;base64,">
            </div>
            <div v-if="!logedin" class="x-padding">
                <form autocomplete="off">
                    <p class="label h4">
                        {{signin ? "enter your" : "create a"}} username
                    </p>
                    <div class="input-container">
                        <input class="input" type="text" placeholder="Username" @keydown="removeError">
                        <p class="error-text error-text-inactive">Please enter a valid Username.</p>
                    </div>
                    <p class="label h4">
                        {{signin ? "enter your" : "create a"}} password
                    </p>
                    <div class="input-container">
                        <input class="input" type="password" placeholder="Password" @keydown="removeError">
                        <p class="error-text error-text-inactive">Please enter a valid Password.</p>
                    </div>
                    <div class="submit-container">
                        <button type="button" class="submit-btn" @click="checkInputs">
                            {{signin ? "Sign In" : "Sign up"}}
                        </button>
                    </div>
                </form>
                <hr>
                <div class="change-option-container">
                    <p>
                        Do you {{signin ? "want to create" : "already have"}} an account?
                    </p>
                    <button class="submit-btn" @click="changeSigns">
                        Go {{signin ? "to Sign Up" : "back to Sign In"}}
                    </button>
                </div>
            </div>
            <div v-else class="x-padding">
                <div class="mb-5">
                    <p class="label h4">
                        You are signed up already
                    </p>
                </div>
                <hr>
                <div class="change-option-container">
                    <p>
                        Do you want to log out?
                    </p>
                    <button class="submit-btn" @click="logoutMsg">
                        Log Out
                    </button>
                </div>
            </div>
        </div>
    </div>
</template>

<script>
import { mapGetters, mapMutations } from "vuex";

export default {
    name: "Signin",
    computed: {
        ...mapGetters(["signin", "signinMsg", "signinMsgMeaning", "signinMsgShow", "logedin"]),
    },
    methods: {
        ...mapMutations(["openCloseLogin", "signinToSignup", "createAccount", "loginAccount", "showRemoveMsg", "logout"]),
        // Here there are 2 different methots just in case if conditions for the username and tha password have to be differents.
        checkUsername(el) {
            if(el.value.trim() !== "" && el.value.trim().length !== 0  && el.value.trim() === el.value) {
                return true;
            }
            el.classList.add("input-error");
            el.parentNode.lastChild.classList.remove("error-text-inactive");
        },
        checkPassword(el) {
            if(el.value.trim() !== "" && el.value.trim().length !== 0  && el.value.trim() === el.value) {
                return true;
            }
            el.classList.add("input-error");
            el.parentNode.lastChild.classList.remove("error-text-inactive");
        },
        checkInputs(el) {
            const username = el.target.parentNode.previousSibling.previousSibling.previousSibling.firstChild;
            const passowrd = el.target.parentNode.previousSibling.firstChild;
            const usernameCorrect = this.checkUsername(username);
            const passwordCorrect = this.checkPassword(passowrd);
            if(usernameCorrect === true && passwordCorrect === true) {
                if(this.signin) {
                    this.loginAccount([username.value, passowrd.value]);
                }
                else {
                    this.createAccount([username.value, passowrd.value]);
                }
                this.showRemoveMsg();
            }
        },
        removeError(el) {
            el.target.classList.remove("input-error");
            el.target.parentNode.lastChild.classList.add("error-text-inactive");
        },
        changeSigns() {
            document.querySelectorAll(".input").forEach(e => {
                e.value = "";
                e.classList.remove("input-error");
            });
            document.querySelectorAll(".error-text").forEach(e => e.classList.add("error-text-inactive"));
            this.signinToSignup();
        },
        logoutMsg() {
            this.logout();
            this.showRemoveMsg();
        },
    },
}
</script>

